import styled from 'styled-components';

const StyledSectionButton = styled.button`
    background : ${p-light};
    color: rgba($color: #000000, $alpha: 0.5);


    &:hover {
        background-color : ${primary};
        border : 1px solid black;
        color: white;
    }
`

export default StyledSectionButton;
